import React from 'react'

const Logout =(props)=>{
    cocomponentDidMount = ()=>{
    const cle = sessionStorage.getItem('token')
    if(cle){
        sessionStorage.removeItem('token')
        props.history.push("./login")
        window.located.reload()
    }
}
    return (
        <div>
            
        </div>
    )
}

export default Logout
